import React, { Component } from 'react'

export default class Header extends Component {
  render() {
    return (
      <header>
        <div>
          <h3>Caroline Nunes</h3>
        </div>
        <section>
          <p>Home</p>
          <p>Sobre Mim</p>
          <p>Skills</p>
          <p>Projetos</p>
          <p>Contato</p>
        </section>
      </header>
    )
  }
}
